import { useForm, Controller } from 'react-hook-form';
import './Editor.css';


function Editor() {

  return (
    <div className="Editor">
        <h2>Создание поста</h2>
         <form>
            <input type='text' placeholder='Название поста' {...register("title", { required: "Заголовок обязателен" })}/>

            <textarea type='text' placeholder='Содержание'/>
            <button>Создать</button>
         </form>


    </div>
  );
}

export default Editor;
